import React from "react";
import './AdminLogin.css';
import {useHistory} from "react-router-dom";

function AdminLogin(){
    function navigateTo(){
        const history = useHistory();
        history.pushState('/admin-manager');
    };

    return (
            <div className="bg">
                <h3 style={{color:'white'}}>ADMIN LOGIN</h3>
                <form className="form">
                    <div className="form-group">
                        <input className="form-control" placeholder="Admin"/>
                    </div>
                    <div className="form-group">
                        <input type="password" className="form-control" placeholder="Password"/>
                    </div>
                    <button type="submit" className="btn btn-primary btn-block btn-large" onClick={this.navigateTo()}>Login</button>
                </form>
            </div>
            );
    }
export default AdminLogin;
